import React, { Component } from "react";

import ElementOne from "./body-elements/ElementOne";

class Body extends Component {
  render() {
    return (
      <React.Fragment>
        <ElementOne />
        <div>This is a body</div>
      </React.Fragment>
    );
  }
}

export default Body;
